import React from 'react'

import Modal from '../components/modal/Modal.jsx';


const Donations = ({btn_name, btn_num, setBtnNum, active, setActive }) => {
    return (
        <main>
            <div className="container">
                <Modal num={btn_num} active={active} setActive={setActive} />
            </div>
        </main>
    )
}

export default Donations;
